('TECHBIRD_HISTORY_1995_H2', '5.December 1995', '5.Dezember 1995', '5 dicembre 1995\r\n', 'HISTORY', 4),
('TECHBIRD_HISTORY_1995_TEXT_01', 'Techbird was founded in December 1995, in Vienna Austria. It all started three friends having an idea.', 'Techbird wurde im Dezember 1995 in Wien, Österreich, gegründet. Alles begann mit einer Idee von drei Freunden.\r\n', 'Techbird è stata fondata nel dicembre 1995 a Vienna, in Austria. Tutto è iniziato con tre amici che hanno avuto un\'idea.', 'HISTORY', 5),
('TECHBIRD_HISTORY_1995_TEXT_02', 'Today Techbird consists of over 600 employees.', 'Heute besteht Techbird aus über 600 Mitarbeitern.\r\n', 'Oggi Techbird conta oltre 600 dipendenti.\r\n', 'HISTORY', 6),
('TECHBIRD_HISTORY_2005_H2', 'The country of unlimited possibilities', 'Das Land der unbegrenzten Möglichkeiten\r\n', 'Il paese delle possibilità illimitate\r\n', 'HISTORY', 7),
('TECHBIRD_HISTORY_2005_TEXT_01', 'For its 10 year anniversary Techbird opened the new headquarters California USA in 2005.\n', 'Zum 10-jährigen Jubiläum eröffnete Techbird 2005 den neuen Hauptsitz Kalifornien USA.\r\n', 'Per il suo decimo anniversario Techbird ha aperto la nuova sede in California USA nel 2005.\r\n', 'HISTORY', 8),
('TECHBIRD_HISTORY_2005_TEXT_02', 'Till this they it is Techbirds biggest Locations.', 'Bis dahin sind sie Techbirds größte Standorte.\r\n', 'Fino a questo momento sono le sedi più grandi di Techbirds.\r\n', 'HISTORY', 9),
('TECHBIRD_HISTORY_2015_H2', 'World Wide TECHBIRD\r\n', 'TECHBIRD Weltweit', 'TECHBIRD in tutto il mondo\r\n', 'HISTORY', 10),
('TECHBIRD_HISTORY_2015_TEXT_01', '2015 Techbird celebrated its 20year anniverssary. This year Techbird also expanded to Asia and employeed over 350 people.\n', '2015 feierte Techbird sein 20-jähriges Jubiläum. In diesem Jahr expandierte Techbird auch nach Asien und beschäftigte über 350 Mitarbeiter.\r\n', '2015 Techbird ha celebrato il suo 20° anniversario. Quest\'anno Techbird si è espansa anche in Asia e ha impiegato oltre 350 persone.\r\n', 'HISTORY', 11),
('TECHBIRD_HISTORY_2015_TEXT_02', 'Asia is till this day Techbirds biggest market.\n\n', 'Asien ist bis heute der größte Markt für Techbird.\r\n', 'L\'Asia è fino ad oggi il più grande mercato di Techbirds.\r\n', 'HISTORY', 12),
