('TECHBIRD_PARTNERS_TITLE', 'CUSTOMERS', 'KUNDEN', 'CLIENTI', 'PARTNERS', 39),
('TECHBIRD_EMPLOYEES_TITLE_H1', 'Who makes it happpen?', 'Wer macht es möglich?\r\n', 'Chi lo fa accadere?\r\n', 'EMPLOYEES', 40),
('TECHBIRD_EMPLOYEES_TITLE_H2', 'Our Employees of course!', 'Unsere Mitarbeiter natürlich!\r\n', 'I nostri dipendenti ovviamente!\r\n', 'EMPLOYEES', 41),
('TECHBIRD_EMPLOYEES_TITLE_TEXT', 'In a fast-paced and constantly evolving industry, employees at a digital marketing and sales company need to be adaptable, creative, and strategic. They must stay up-to-date with the latest trends and technologies, have strong communication skills, and be able to work collaboratively with other team members.', 'In einer schnelllebigen und sich ständig weiterentwickelnden Branche müssen Mitarbeiter eines digitalen Marketing- und Vertriebsunternehmens anpassungsfähig, kreativ und strategisch sein. Sie müssen über die neuesten Trends und Technologien auf dem Laufenden bleiben, über ausgeprägte Kommunikationsfähigkeiten verfügen und in der Lage sein, mit anderen Teammitgliedern zusammenzuarbeiten.\r\n', 'In un settore frenetico e in continua evoluzione, i dipendenti di un\'azienda di marketing e vendita digitale devono essere adattabili, creativi e strategici. Devono rimanere aggiornati con le ultime tendenze e tecnologie, avere forti capacità di comunicazione ed essere in grado di lavorare in collaborazione con altri membri del team.\r\n', 'EMPLOYEES', 42),
